import React from "react";

export default function PlaylistComponent({ data }) {
    const videoText = (data.videoCount <= 1) ? "Video" : "Videos";
    return (<div className="VideoComponent">
        {JSON.stringify(data)}
        <div className="Video"> <img src={data.thumbnails[1].url} alt={data.title}/> </div>
        <div className="PlaylistDescription">{data.title} - {data.videoCount} {videoText}</div>
    </div>);
}
